def convert_result(result):
    orderd_result = sorted(result, key=lambda sim: sim[1], reverse=True)
    videos = []

    for item in orderd_result:
        arr = item[0][0].split('?t=')
        url = arr[0]
        start = arr[1]
        predict = item[1]
        video_key = url[url.rindex('/')+1:]

        video = {}
        video["video_key"] = video_key
        video["start"] = start
        video["predict"] = float(predict)
        videos.append(video)

    return videos


predicts = convert_result(result)

print(predicts)

